import React, { useState } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import { useForm } from 'react-hook-form';
import toast from 'react-hot-toast';
import { Heart, Shield, Lock, Eye, EyeOff } from 'lucide-react';
import LoadingSpinner from '../common/LoadingSpinner';

const AdminLogin = () => {
  const [showPassword, setShowPassword] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const { login } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();

  const from = location.state?.from?.pathname || '/admin/dashboard';

  const {
    register,
    handleSubmit,
    formState: { errors }
  } = useForm();

  const onSubmit = async (data) => {
    setIsLoading(true);
    try {
      const result = await login(data, 'admin');

      if (result.success) {
        toast.success('Admin login successful!');
        navigate(from, { replace: true });
      } else {
        toast.error(result.message || 'Admin login failed');
      }
    } catch (error) {
      toast.error('An error occurred during admin login');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="auth-container">
      <div className="auth-card admin-card">
        {/* Header */}
        <div className="auth-header">
          <div className="auth-logo">
            <Heart className="logo-icon" />
            <h1 className="logo-text">Path2Wellness</h1>
          </div>
          <div className="admin-badge">
            <Shield size={20} />
            <span>Admin Portal</span>
          </div>
          <h2 className="auth-title">Doctor Login</h2>
          <p className="auth-subtitle">
            Access patient management and care plan administration
          </p>
        </div>

        {/* Login Form */}
        <form onSubmit={handleSubmit(onSubmit)} className="auth-form">
          {/* Email Field */}
          <div className="form-group">
            <label htmlFor="email" className="form-label">
              <Shield size={16} />
              Doctor Email
            </label>
            <input
              id="email"
              type="email"
              className={`form-input ${errors.email ? 'error' : ''}`}
              placeholder="Enter your doctor email"
              {...register('email', {
                required: 'Email is required',
                pattern: {
                  value: /^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}$/i,
                  message: 'Invalid email address'
                }
              })}
            />
            {errors.email && (
              <span className="error-message">{errors.email.message}</span>
            )}
          </div>

          {/* Password Field */}
          <div className="form-group">
            <label htmlFor="password" className="form-label">
              <Lock size={16} />
              Password
            </label>
            <div className="password-input-container">
              <input
                id="password"
                type={showPassword ? 'text' : 'password'}
                className={`form-input ${errors.password ? 'error' : ''}`}
                placeholder="Enter your password"
                {...register('password', {
                  required: 'Password is required',
                  minLength: {
                    value: 6,
                    message: 'Password must be at least 6 characters'
                  }
                })}
              />
              <button
                type="button"
                className="password-toggle"
                onClick={() => setShowPassword(!showPassword)}
              >
                {showPassword ? <EyeOff size={16} /> : <Eye size={16} />}
              </button>
            </div>
            {errors.password && (
              <span className="error-message">{errors.password.message}</span>
            )}
          </div>

          {/* Submit Button */}
          <button
            type="submit"
            className="btn btn-secondary auth-submit-btn"
            disabled={isLoading}
          >
            {isLoading ? (
              <>
                <LoadingSpinner size="small" />
                Signing In...
              </>
            ) : (
              <>
                <Shield size={16} />
                Admin Sign In
              </>
            )}
          </button>
        </form>

        {/* Footer Links */}
        <div className="auth-footer">
          <p className="auth-link-text">
            Are you a patient?{' '}
            <Link to="/login" className="auth-link">
              Patient Login
            </Link>
          </p>
        </div>
      </div>

      {/* Demo Credentials */}
      <div className="demo-credentials admin-demo">
        <h3>Demo Admin Credentials</h3>
        <div className="demo-account">
          <strong>Doctor Account:</strong>
          <p>Email: doctor@demo.com</p>
          <p>Password: admin123</p>
        </div>
        <div className="admin-features">
          <h4>Admin Features:</h4>
          <ul>
            <li>Manage all patient care plans</li>
            <li>Create and update care plans</li>
            <li>Monitor patient progress</li>
            <li>Delete expired care plans</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default AdminLogin;
